import { AUTH_USER_SUCCESSFUL } from '../actionTypes/actionTypes';

export const authUserSuccessful = (userInfo) => dispatch => {

  dispatch({
    type: AUTH_USER_SUCCESSFUL,
    payload: userInfo
  })

}
